import axios from 'axios';
import Api from '@/utils/Api';


export function createPNUser(data) {
    console.log(data,"data in createUser")
    axios.post('https://notifier-staging.tokopedia.com/imt/api/v1/user/add',{headers:{
        'X-GA-ID':'2377',
    },data})
        .then(function (response) {
            if (response){
                alert("you are subscribed with user id "+response.data.userId)
            }
        })
        .catch(function (error) {
        });
}



export const fetchUserRequest = () => {
    Api.addPNUser()
        .then(res => {
            console.log(res,"response is here")
        })
        .catch(err => {
            console.log("error is here",err)
        });
};
